import React from 'react';
import {  Menu } from 'antd';
import { Link } from 'react-router-dom';

const LeftMenu = () => {

    return (
        <Menu>
            <Menu.Item key={1}><Link to="/calendar">Calendar</Link></Menu.Item>
            <Menu.Item key={2}><Link to="/">Treatments</Link></Menu.Item>
            <Menu.Item key={3}><Link to="/">Recipes</Link></Menu.Item>
            <Menu.Item key={4}><Link to="/">Employees</Link></Menu.Item>
            <Menu.Item key={4}><Link to="/">Settings</Link></Menu.Item>
        </Menu>
    )

}

export default LeftMenu;
